import Card from "../layout/card/Card";
import "./HomePage.scss";
import Search from "../layout/search/Search";
import MobileNav from "./mobile-nav/MobileNav";
import SignatureDishes from "./signature-dishes/SignatureDishes";
import PopularRestaurants from "./popular-restaurants/PopularRestaurants";
import Icons from "./Icons";
import Chef from "./mobile-nav/chef/Chef";
import About from "./about/About";
import DummyData from "./DummyData";

const HomePage: React.FC = () => {
  return (
    <div className="home-page">
      <div className="card-bg">
        <Card>
          <p>Epicure works with the top chef restaurants in Tel Aviv</p>
          <Search></Search>
        </Card>
      </div>
      <MobileNav></MobileNav>
      <PopularRestaurants></PopularRestaurants>
      <SignatureDishes></SignatureDishes>
      <Icons></Icons>
      <Chef></Chef>
      <About></About>
    </div>
  );
};

export default HomePage;
